import React from "react";
import SearchBar from "./SearchBar";
import { NavBar } from "../styles/Nav";

export default function Nav() {
  return (
    <div>
      <NavBar>
        <SearchBar onSearch={(ciudad) => alert(ciudad)} />
      </NavBar>
    </div>
  );
}
